import React, { Component } from 'react';

//welcome
class Welcome extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }
  render() {
    return (
      <div>
        <Head>
                <title>My page title333</title>
                <meta name="viewport" content="initial-scale=1.0, width=device-width" />
                </Head>
          Welcome to next.js!
      </div>
    )
  }
}

export default Welcome
